<!DOCTYPE html>
<html lang="en">
    <head>
       {% partial 'head' %}
    </head>
    <body>
    <!-- preloader area start -->
    <div class="preloader" id="preloader">
    <div class="preloader-inner">
      <div class="cube-wrapper">
        <div class="cube-folding">
          <span class="leaf1"></span>
          <span class="leaf2"></span>
          <span class="leaf3"></span>
          <span class="leaf4"></span>
        </div>
        <span class="loading" data-name="Loading">Loading</span>
      </div>
    </div>
  </div>

    <!-- header -->
    {% partial 'header' %}
    
    <!-- Page -->
    {% page %}

    <!-- footer -->
    {% partial 'footer'%}

    <!-- Back to Top Start -->
    <div class="bottomtotop">
        <i class="fa fa-chevron-right"></i>
    </div>
    <!-- Back to Top End -->

<!-- jquery -->
<script src="{{'assets/js/jquery.js'|theme}}"></script>
<!-- popper -->
<script src="{{'assets/js/popper.min.js'|theme}}"></script>
<!-- bootstrap -->
<script src="{{'assets/js/bootstrap.min.js'|theme}}"></script>
<!-- way poin js-->
<script src="{{'assets/js/waypoints.min.js'|theme}}"></script>
<!-- owl carousel -->
<script src="{{'assets/js/owl.carousel.min.js'|theme}}"></script>
<!-- magnific popup -->
<script src="{{'assets/js/jquery.magnific-popup.js'|theme}}"></script>
<!-- aos js-->
<script src="{{'assets/js/aos.js'|theme}}"></script>
<!-- counterup js-->
<script src="{{'assets/js/jquery.countdown.min.js'|theme}}"></script>
<!-- easing js-->
<script src="{{'assets/js/jquery.easing.1.3.js'|theme}}"></script>
<!-- Map js -->
<script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyC7eALQrRUekFNQX71IBNkxUXcz-ALS-MY&amp;sensor=false"></script>
<script src="{{'assets/js/gmap.js'|theme}}"></script>
<!-- main -->
<script src="{{'assets/js/contact.js'|theme}}"></script>
<!-- main -->
<script src="{{'assets/js/main.js'|theme}}"></script>
</body>
</html>
